import ServicesMixin from './services-mixin.js';

export default {
    mixins: [ServicesMixin],
    data () {
        return {
            BACKEND_ENDPOINT: 'http://localhost:8888',
            LINKED_IN_CONTROLLER_ENDPOINT: this.BACKEND_ENDPOINT + '/linked-in/',
            LINKED_IN_KEY_EXCHANGE_ENDPOINT: 'https://www.linkedin.com/oauth/v2',
            USER_DETAILS_ENDPOINT: this.BACKEND_ENDPOINT + 'user-details',
            EMAIL_ENDPOINT: this.BACKEND_ENDPOINT + 'user-email',

            tokenExchange: {
                client_id: '86s3vawi4jxs3s',
                client_secret: 'BIBJZqm7NpwkGT29',
                grant_type: 'authorization_code',
                redirect_uri: 'http://localhost:8083',
                code: 'AQQgi7mphck92ve3t9ynJxTSFV_InvLQXHzyxazesZ4_srRq3bm9ZVRFj6-iVCBxz6qsl3bnKAV7KmtN6FTrkoF0TovqtO3hM0XMi4h_wADzqt7cNf_EUNR2VtUXErNOeO7gXchJhX6fb9f0PoB_W10h6S_2WZ3oXFSR5me9Oel6YytAyf5MrSKReiKQIA'
            },

            functions: {
                exchangeAuthorizationCodeWithAccessToken: function (authorizationCode) {
                    console.log('here');
                    const endpoint = this.LINKED_IN_KEY_EXCHANGE_ENDPOINT + '/accessToken?'
                        + 'client_id=' + this.client_id + '&client_secret=' + this.client_secret
                        + '&grant_type=' + this.grant_type + '&redirect_uri=' + this.redirect_uri
                        + '&code=' + this.code;

                    Vue.axios.post(endpoint).then(response => {
                        console.log(response);
                    })
                }
            }
        }
    }
}
